import './App.css';
import { Route, BrowserRouter as Router, Switch, NavLink } from "react-router-dom"
import Home from "./components/Home"

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <NavLink className="links" to="/">Home</NavLink>
        </nav>
        <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
      </Switch>
      </div>
    </Router>
  );
}

export default App;
